INSERT INTO `sys_history` (`uid`, `pid`, `sys_log_uid`, `history_data`, `fieldlist`, `recuid`, `tablename`, `tstamp`, `history_files`, `snapshot`) VALUES (71,0,438,'a:2:{s:9:\"oldRecord\";a:2:{s:8:\"bodytext\";s:1671:\"<div><span style=\"font-size: 12px;\">&nbsp; &nbsp; $ cp TYPO3SkeletonWebsite/web/_.htaccess TYPO3SkeletonWebsite/web/.htaccess</span></div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; $ nano apache/vhost.conf</div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; # TYPO3SkeletionWebsite</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &lt;VirtualHost *:80&gt;</div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DocumentRoot &quot;/path/to/TYPO3SkeletonWebsite/web&quot;</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ServerName dummy.local</div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;Directory /path/to/typo3/TYPO3SkeletonWebsite/web&gt;</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DirectoryIndex index.php index.html</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Options -Indexes +FollowSymLinks</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; AllowOverride None</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Order allow,deny</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; allow from all</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; # Only by local development</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Require all granted</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;/Directory&gt;</div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ErrorLog &quot;logs/hw-error_log&quot;</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CustomLog &quot;logs/hw-access_log&quot; common</div>\r\n<div></div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &lt;/VirtualHost&gt;</div>\";s:15:\"l18n_diffsource\";s:430:\"a:22:{s:5:\"CType\";N;s:6:\"colPos\";N;s:16:\"sys_language_uid\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:8:\"bodytext\";N;s:11:\"rte_enabled\";N;s:6:\"layout\";N;s:11:\"spaceBefore\";N;s:10:\"spaceAfter\";N;s:13:\"section_frame\";N;s:6:\"hidden\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:14:\"tx_flux_parent\";N;s:14:\"tx_flux_column\";N;}\";}s:9:\"newRecord\";a:2:{s:8:\"bodytext\";s:1357:\"&nbsp; &nbsp; $ cp TYPO3SkeletonWebsite/web/_.htaccess TYPO3SkeletonWebsite/web/.htaccess\r\n&nbsp; &nbsp; $ nano apache/vhost.conf\r\n&nbsp; &nbsp; &nbsp; &nbsp; # TYPO3SkeletionWebsite\r\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;VirtualHost *:80&gt;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DocumentRoot &quot;/path/to/TYPO3SkeletonWebsite/web&quot;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ServerName dummy.local\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;Directory /path/to/typo3/TYPO3SkeletonWebsite/web&gt;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DirectoryIndex index.php index.html\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Options -Indexes +FollowSymLinks\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; AllowOverride None\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Order allow,deny\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; allow from all\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; # Only by local development\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Require all granted\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;/Directory&gt;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ErrorLog &quot;logs/hw-error_log&quot;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CustomLog &quot;logs/hw-access_log&quot; common\r\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/VirtualHost&gt;\";s:15:\"l18n_diffsource\";s:382:\"a:20:{s:5:\"CType\";N;s:6:\"colPos\";N;s:16:\"sys_language_uid\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:8:\"bodytext\";N;s:11:\"rte_enabled\";N;s:6:\"layout\";N;s:11:\"spaceBefore\";N;s:10:\"spaceAfter\";N;s:13:\"section_frame\";N;s:6:\"hidden\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;}\";}}','bodytext,l18n_diffsource',8,'tt_content',1376935915,NULL,0);
INSERT INTO `sys_history` (`uid`, `pid`, `sys_log_uid`, `history_data`, `fieldlist`, `recuid`, `tablename`, `tstamp`, `history_files`, `snapshot`) VALUES (72,0,439,'a:2:{s:9:\"oldRecord\";a:2:{s:8:\"bodytext\";s:429:\"This command import the three sql files _Structure, _ReadOnly and _Data into the MySQL Database you will.\r\n$ bash StartProject.sh sync\r\nThis command export your work from database in three sql files _Structure, _ReadOnly and _Data.\r\n$ bash StartProject.sh dump\r\nThis command it special, this create an one _Full.sql Backup file with what you can import to another database and it create all you need.\r\n$ bash StartProject.sh full\";s:15:\"l18n_diffsource\";s:69:\"a:3:{s:6:\"colPos\";N;s:14:\"tx_flux_column\";N;s:14:\"tx_flux_parent\";N;}\";}s:9:\"newRecord\";a:2:{s:8:\"bodytext\";s:637:\"This command import the three sql files _Structure, _ReadOnly and _Data into the MySQL Database you will.\r\n<span style=\"font-size: 12px; \">&nbsp; &nbsp;</span><span style=\"font-size: 12px; \">&nbsp;</span>$ bash StartProject.sh sync\r\nThis command export your work from database in three sql files _Structure, _ReadOnly and _Data.\r\n&nbsp; &nbsp; $ bash StartProject.sh dump\r\nThis command it special, this create an one _Full.sql Backup file with what you can import to another database and it create all you need.\r\n<span style=\"font-size: 12px; \">&nbsp; &nbsp;</span><span style=\"font-size: 12px; \">&nbsp;</span>$ bash StartProject.sh full\";s:15:\"l18n_diffsource\";s:382:\"a:20:{s:5:\"CType\";N;s:6:\"colPos\";N;s:16:\"sys_language_uid\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:8:\"bodytext\";N;s:11:\"rte_enabled\";N;s:6:\"layout\";N;s:11:\"spaceBefore\";N;s:10:\"spaceAfter\";N;s:13:\"section_frame\";N;s:6:\"hidden\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;}\";}}','bodytext,l18n_diffsource',3,'tt_content',1376935934,NULL,0);
