n<span style=\"font-size: 12px; \">* &nbsp; Extension Builder v2.5.2</span>\r\n* &nbsp;&nbsp;Tools for Extbase development v1.3.0 (pt_extbase)\r\n* &nbsp; PHPUnit v3.7.22\r\n<div>* &nbsp; phpMyAdmin v4.16.0</div>\";}}','bodytext',1,'tt_content',1383733234,NULL,0);
