 Fluid FlexForms v6.0.1</span>\r\n* &nbsp; VHS: ViewHelpers v1.8.2\r\n* &nbsp; Fluid Widget v1.1.0\r\n* &nbsp; Fluid Content Engine v3.1.0\r\n* &nbsp; Fluid Page Template Engine v2.1.0\r\n* &nbsp; RealURL v1.12.6\r\n<span style=\"font-size: 12px; \">* &nbsp; Extension Builder v2.5.2</span>\r\n* &nbsp;&nbsp;Tools for Extbase development v1.3.0 (pt_extbase)\r\n* &nbsp; PHPUnit v3.7.22\r\n<div>* &nbsp; phpMyAdmin v4.16.0</div>',NULL,0,0,NULL,2,0,NULL,0,0,0,NULL,NULL,0,0,0,'',0,0,'','','',NULL,0,0,0,0,NULL,NULL,NULL,'0','0','',0,0,0,0,'',1,0,NULL,0,'','',0,0,NULL,0,0,0,0,0,0,NULL,'',0,'',0,'a:20:{s:5:\"CType\";N;s:6:\"colPos\";N;s:16:\"sys_language_uid\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:8:\"bodytext\";N;s:11:\"rte_enabled\";N;s:6:\"layout\";N;s:11:\"spaceBefore\";N;s:10:\"spaceAfter\";N;s:13:\"section_frame\";N;s:6:\"hidden\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;}',NULL,'',0,NULL,NULL,NULL);
